UPDATE `quest_template` SET `QuestDescription`='Now that we\'ve gotten back to what we aimed to do, we need to have a talk tusk to tusk. That gnoll Frostbite? The one you spoke to?\n\nWe\'ve got a history with him.\n\nThis may take awhile to explain. You go and get some fish while I talk, pup. We need to feed everyone. They need their strength for what\'s next.', `VerifiedBuild`=49444 WHERE `ID`=71013; -- No Vengeance on an Empty Stomach
